import { Categorie } from "../Enums/Categorie";

export default abstract class RaceEntry {
  _id: string = "";
  club: string;
  categorie: Categorie;

  /**
   * Getter id
   * @return {string}
   */
  public get id(): string {
    return this._id;
  }

  /**
   * Setter id
   * @param {string} value
   */
  public set id(value: string) {
    this._id = value;
  }
}
